import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

function createData(name, calories, fat, carbs, protein) {
  return { name, calories, fat, carbs, protein };
}

const rows = [
  createData('Academic Q1', 'â‚¹ '+3000, 6.0, 24, 4.0),
  createData('Academic Q2', 237, 9.0, 37, 4.3),
  createData('Academic Q3', 262, 16.0, 24, 6.0),
  createData('Academic Q4', 305, 3.7, 67, 4.3),
];

export default function BasicTable() {
  return (
    <TableContainer component={Paper}>
      <Table aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell style={{ fontFamily: 'Poppins', fontStyle: 'normal', fontWeight: '600', fontSize: '20px', lineHeight: '30px', color: '#545454', paddingLeft: '46px' }}>Fees Type</TableCell>
            <TableCell align="center" style={{ fontFamily: 'Poppins', fontStyle: 'normal', fontWeight: '600', fontSize: '20px', lineHeight: '30px', color: '#545454' }}>Amount</TableCell>
            <TableCell align="center" style={{ fontFamily: 'Poppins', fontStyle: 'normal', fontWeight: '600', fontSize: '20px', lineHeight: '30px', color: '#545454' }}>Due Date</TableCell>
            <TableCell align="center" style={{ fontFamily: 'Poppins', fontStyle: 'normal', fontWeight: '600', fontSize: '20px', lineHeight: '30px', color: '#545454' }}>Late Payment</TableCell>
            <TableCell align="center" style={{ fontFamily: 'Poppins', fontStyle: 'normal', fontWeight: '600', fontSize: '20px', lineHeight: '30px', color: '#545454' }}>Date Submitted</TableCell>
            <TableCell align="center" style={{ fontFamily: 'Poppins', fontStyle: 'normal', fontWeight: '600', fontSize: '20px', lineHeight: '30px', color: '#545454' }}>&nbsp;</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow
              key={row.name}
              sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
              <TableCell style={{ fontFamily: 'Lato', fontStyle: 'normal', fontWeight: '500', fontSize: '18px', lineHeight: '22px', color: '#000000', paddingLeft: '46px' }}>
                {row.name}
              </TableCell>
              <TableCell align="center" style={{ fontFamily: 'Lato', fontStyle: 'normal', fontWeight: '500', fontSize: '18px', lineHeight: '22px', color: '#000000' }}>{row.calories}</TableCell>
              <TableCell align="center" style={{ fontFamily: 'Lato', fontStyle: 'normal', fontWeight: '500', fontSize: '18px', lineHeight: '22px', color: '#000000' }}>{row.fat}</TableCell>
              <TableCell align="center" style={{ fontFamily: 'Lato', fontStyle: 'normal', fontWeight: '500', fontSize: '18px', lineHeight: '22px', color: '#000000' }}>{row.carbs}</TableCell>
              <TableCell align="center" style={{ fontFamily: 'Lato', fontStyle: 'normal', fontWeight: '500', fontSize: '18px', lineHeight: '22px', color: '#000000' }}>{row.protein}</TableCell>
              <TableCell align="center" style={{ fontFamily: 'Lato', fontStyle: 'normal', fontWeight: '500', fontSize: '18px', lineHeight: '22px', color: '#000000' }}>{row.protein}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
